// src/data/services.js
const services = [
  {
    key: 'hair',
    title: 'Hair Cutting',
    subtitle: 'Latest cuts aur styling',
    items: [
      { name: 'Classic Bob', price: 500 },
      { name: 'Layered Cut', price: 700 },
      { name: 'Pixie Cut', price: 800 },
      { name: 'Undercut', price: 900 },
      { name: 'Trim & Finish', price: 300 }
    ]
  },
  {
    key: 'makeup',
    title: 'Beauty / Makeup',
    subtitle: 'Bridal aur party makeup',
    items: [
      { name: 'Day Makeup', price: 1200 },
      { name: 'Party Glam', price: 1800 },
      { name: 'Bridal Makeup', price: 5000 }
    ]
  },
  {
    key: 'mehendi',
    title: 'Mehendi',
    subtitle: 'Simple se intricate designs',
    items: [
      { name: 'Simple Design', price: 300 },
      { name: 'Half-hand', price: 800 },
      { name: 'Full Bridal', price: 2500 }
    ]
  }
];

export default services;
